import React from 'react';
import BreweryDetail from '../components/BreweryDetail'

const BreweriesList = ({data})=>{

    const listArr = data.map(brew => <BreweryDetail data={data}/>)

    return <div>{listArr}</div>
}

export default BreweriesList;
